import React from "react";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";


import styles from "assets/jss/material-kit-react/views/componentsSections/basicsStyle.js";

const useStyles = makeStyles(styles);

export default function SectionBasics() {
  const classes = useStyles();


  return (
    <div className={classes.sections}>
      <div className={classes.container}>
        <div className={classes.title}>
          <h2><b>Brief Introduction</b></h2>
          <hr  style={{borderTop:"1px solid #bbb", borderRadius:"5px"}}/>
        </div>
        <div className="row" style={{display:"flex"}}>
          <div class="col">
          <h3>Hi, My name is Tanishq Sandhu.<br></br><br></br>

            I am currently pursuing my Bachelor's Degree in Computer Science at the Georgia Institute of Technology with a specialization in Intelligence and Information-Internetworks.

          </h3>
            </div> 
            <div class="LI-profile-badge"  data-version="v1" data-size="large" data-locale="en_US" data-type="vertical" data-theme="light" data-vanity="tanishqsandhu"><a  target="_blank" class="LI-simple-link" href='https://www.linkedin.com/in/tanishqsandhu?trk=profile-badge'>Tanishq Sandhu</a></div>
            <a style={{display: "inline-block", border: "0", textDecoration: "none"}} href="http://vsco.co/tanishqsandhu?utm_source=user_grid&utm_medium=user_website&utm_campaign=link_to_grid"><img style={{width: "48px", height: "48px", margin: "0px;"}} src="http://assets.vsco.co/assets/images/assets/Logo_black_48.png" alt="VSCO Logo" /></a>
        </div>
      </div>
    </div>
  );
}
